description:
Regional Land Supply Assessment reports assess land for future residential, industrial and commercial uses, providing context for the land use planning and infrastructure provision required to meet demand across selected regional centres. The reports provide information on:
•   demand drivers specific to each centre, including the major economic factors that influence employment and population growth, and therefore, the demand for land and housing;
•   zoned land supply for residential, commercial and industrial uses;
•   development constraints;
•   recent and future land development activity; and
•   existing and required physical infrastructure. 

Future development areas are identified through a variety of means, including:
•   local planning scheme zonings and amendments;
•   developer intentions;
•   consultation with local stakeholders;
•   subdivision applications/approvals;
•   local government development applications/approvals; and
•   structure planning.

Passive river tracers results for 35 rivers of significance to the Reef 2050 Water Quality Improvement Plan, derived from version 4.0 of the eReefs 4km-resolution regional-scale hydrodynamic model of the Great Barrier Reef (GBR4). 
This model is forced with:
1. Surface Atmospheric Data: Bureau of Meteorology Atmospheric high-resolution Regional Reanalysis for Australia, using Data Assimilation of Quality Control observations (BARRA);
2. Ocean Boundaries: CSIRO Bluelink Reanalysis using Data Assimilation of Quality Control observations (BRAN2020) model results;
3. Tide: global TPXO tide model;
4. River boundaries: measured stream flow and temperature data for 64 rivers from a combination of the Bureau of Meteorology Grid 2 Grid catchment model (G2Gv3) and the QLD DES Source catchment model.
This dataset contains passive tracer results for 35 significant rivers which contribute to calculations for the Reef 2050 Water Quality Improvement Plan Reef Report Cards. This model configuration and associated results dataset may be referred to as "GBR4_H4p0_ABARRAr2_OBRAN2020_FG2Gv3_Dhnd_Rivers" according to the eReefs simulation naming protocol. 
The model ran in hindcast mode and is complete. It succeeds the GBR4_H2p0_Rivers model as the best available eReefs river tracer model results for its timespan.

This layer contains aspatial details for all properties in Victoria. A property is defined as land, usually contiguous, under one ownership, and of a common class and tenure. It is used for land under common occupation particularly for the purpose of rating, billing or habitation. Properties are typically described by street address allocated by an authority such as local government.

It includes:
- Property numbers as allocated by local governement authority;
- Registered and proposed status;
- Type of property, ie, single or multi-assessment;
- LGA code;
- Unique Feature Identifiers, date stamps and data quality information.

Address information IS NOT included in Vicmap Property.
MetaX records this dataset as VMPROP.PROPERTY
